  `USER_ID` bigint(20) NOT NULL AUTO_INCREMENT,
  `USER_NAME` varchar(100) CHARACTER SET latin1 COLLATE latin1_swedish_ci NOT NULL,
  `USER_TYPE` bigint(20) NOT NULL,
  `SURNAME` varchar(100) CHARACTER SET latin1 COLLATE latin1_swedish_ci NOT NULL,
  `OTHER_NAMES` varchar(100) CHARACTER SET latin1 COLLATE latin1_swedish_ci NOT NULL,
  `MOBILE` varchar(25) CHARACTER SET latin1 COLLATE latin1_swedish_ci NOT NULL,
  `EMAIL` varchar(100) CHARACTER SET latin1 COLLATE latin1_swedish_ci NOT NULL,
  `LOCATION_ID` bigint(20) NULL DEFAULT NULL,
  `PASSWORD` varchar(100) CHARACTER SET latin1 COLLATE latin1_swedish_ci NOT NULL,
  `DATE_REGISTERED` datetime(0) NULL DEFAULT NULL,
  `LAST_UPDATED` datetime(0) NULL DEFAULT NULL,
  `CLIENT_TOKEN` varchar(255) CHARACTER SET latin1 COLLATE latin1_swedish_ci NULL DEFAULT NULL,
  `RESET_TOKEN` varchar(100) CHARACTER SET latin1 COLLATE latin1_swedish_ci NOT NULL,
  `USER_STATUS` bit(1) NULL DEFAULT b'1' COMMENT 'Indicate if user is active or not',
  `TOKEN_EXPPIRY` timestamp(0) NULL DEFAULT NULL,
  PRIMARY KEY (`USER_ID`) USING BTREE,
  UNIQUE INDEX `USER_NAME`(`USER_NAME`) USING BTREE,
  UNIQUE INDEX `EMAIL`(`EMAIL`) USING BTREE,
  INDEX `LOCATION_ID_idx`(`LOCATION_ID`) USING BTREE,
  INDEX `USER_TYPE_idx`(`USER_TYPE`) USING BTREE,
  INDEX `DATE_REGISTERED`(`DATE_REGISTERED`) USING BTREE,
  CONSTRAINT `tb_users_ibfk_2` FOREIGN KEY (`USER_TYPE`) REFERENCES `user_type` (`USER_TYPE_ID`) ON DELETE RESTRICT ON UPDATE CASCADE
) ENGINE = InnoDB AUTO_INCREMENT = 645 CHARACTER SET = latin1 COLLATE = latin1_swedish_ci ROW_FORMAT = Dynamic;

