-- ----------------------------
-- View structure for vw_order_items
-- ----------------------------
DROP VIEW IF EXISTS `vw_order_items`;
CREATE ALGORITHM = UNDEFINED DEFINER = `pizzaout`@`localhost` SQL SECURITY DEFINER VIEW `vw_order_items` AS select `customer_order`.`ORDER_ID` AS `ORDER_ID`,`customer_order_item`.`QUANTITY` AS `QUANTITY`,`customer_order_item`.`PRICE` AS `PRICE`,`customer_order_item`.`SUBTOTAL` AS `SUBTOTAL`,`menu_item_type`.`ITEM_TYPE_SIZE` AS `ITEM_TYPE_SIZE`,`menu_item`.`MENU_ITEM_NAME` AS `MENU_ITEM_NAME`,`menu_category`.`MENU_CAT_NAME` AS `MENU_CAT_NAME`,`menu_category`.`MENU_CAT_IMAGE` AS `MENU_CAT_IMAGE`,`menu_item`.`MENU_ITEM_IMAGE` AS `MENU_ITEM_IMAGE`,`customer_order`.`USER_ID` AS `USER_ID` from ((((`customer_order` join `customer_order_item` on((`customer_order_item`.`ORDER_ID` = `customer_order`.`ORDER_ID`))) join `menu_item_type` on((`customer_order_item`.`ITEM_TYPE_ID` = `menu_item_type`.`ITEM_TYPE_ID`))) join `menu_item` on((`menu_item_type`.`MENU_ITEM_ID` = `menu_item`.`MENU_ITEM_ID`))) join `menu_category` on((`menu_item`.`MENU_CAT_ID` = `menu_category`.`MENU_CAT_ID`)));

-- ----------------------------
-- View structure for vw_orders
-- ----------------------------
DROP VIEW IF EXISTS `vw_orders`;
CREATE ALGORITHM = UNDEFINED DEFINER = `pizzaout`@`localhost` SQL SECURITY DEFINER VIEW `vw_orders` AS select `customer_order`.`ORDER_ID` AS `ORDER_ID`,`customer_order`.`USER_ID` AS `USER_ID`,`customer_order`.`ORDER_DATE` AS `ORDER_DATE`,`customer_order`.`PAYMENT_METHOD` AS `PAYMENT_METHOD`,`customer_order`.`ORDER_STATUS` AS `ORDER_STATUS`,`customer_order`.`ORDER_TIME` AS `ORDER_TIME`,`customer_order`.`NOTES` AS `NOTES`,`customer_order`.`CREATED_AT` AS `CREATED_AT`,`customer_order`.`UPDATED_AT` AS `UPDATED_AT`,`customer_order`.`TABLE_NUMBER` AS `TABLE_NUMBER`,`customer_order`.`ORDERED_BY` AS `ORDERED_BY`,`customer_order`.`UPDATED_BY` AS `UPDATED_BY`,`payment`.`PAYMENT_ID` AS `PAYMENT_ID`,`payment`.`PAYMENT_CHANNEL` AS `PAYMENT_CHANNEL`,`payment`.`PAYMENT_AMOUNT` AS `PAYMENT_AMOUNT`,`payment`.`PAYMENT_REF` AS `PAYMENT_REF`,`payment`.`PAYMENT_STATUS` AS `PAYMENT_STATUS`,`payment`.`PAYMENT_DATE` AS `PAYMENT_DATE`,`payment`.`PAYMENT_NOTES` AS `PAYMENT_NOTES`,`payment`.`PAYMENT_NUMBER` AS `PAYMENT_NUMBER`,`payment`.`AMOUNT_RECEIVED` AS `AMOUNT_RECEIVED`,`payment`.`CHANGE_DUE` AS `CHANGE_DUE` from (`customer_order` left join `payment` on((`payment`.`ORDER_ID` = `customer_order`.`ORDER_ID`)));

-- ----------------------------
-- View structure for vw_sales_reports
-- ----------------------------
DROP VIEW IF EXISTS `vw_sales_reports`;
CREATE ALGORITHM = UNDEFINED DEFINER = `root`@`localhost` SQL SECURITY DEFINER VIEW `vw_sales_reports` AS select `customer_order`.`ORDER_ID` AS `ORDER_ID`,`customer_order`.`USER_ID` AS `USER_ID`,`customer_order`.`LOCATION_ID` AS `LOCATION_ID`,`customer_order`.`KITCHEN_ID` AS `KITCHEN_ID`,`customer_order`.`CHEF_ID` AS `CHEF_ID`,`customer_order`.`RIDER_ID` AS `RIDER_ID`,`customer_order`.`ORDER_DATE` AS `ORDER_DATE`,`customer_order`.`PAYMENT_METHOD` AS `PAYMENT_METHOD`,`customer_order`.`ORDER_STATUS` AS `ORDER_STATUS`,`customer_order`.`ORDER_TIME` AS `ORDER_TIME`,`customer_order`.`NOTES` AS `NOTES`,`customer_order`.`CREATED_AT` AS `CREATED_AT`,`customer_order`.`UPDATED_AT` AS `UPDATED_AT`,`customer_order`.`TABLE_NUMBER` AS `TABLE_NUMBER`,`customer_order`.`ORDERED_BY` AS `ORDERED_BY`,`customer_order`.`UPDATED_BY` AS `UPDATED_BY`,`tb_users`.`USER_NAME` AS `USER_NAME`,`tb_users`.`USER_TYPE` AS `USER_TYPE`,`tb_users`.`SURNAME` AS `SURNAME`,`tb_users`.`OTHER_NAMES` AS `OTHER_NAMES` from (`customer_order` join `tb_users` on((`customer_order`.`UPDATED_BY` = `tb_users`.`USER_ID`)));

SET FOREIGN_KEY_CHECKS = 1;
